import axios from 'axios'

function JsonParse() {



    const [cdmData, setCdmData] = useState([])


	useEffect(() => {
		axios
			.get(`http://127.0.0.1:5000/api_cdm/available_data_test`)
            //.get(`http://127.0.0.1:5000/api_cdm/available_data`)
			.then(res => {
                // console.log(res)
                setCdmData(res.data)
			})
			.catch(err => {
				console.log(err)
			})
	}, [])


    // const obj = JSON.parse(cdmData);
    // console.log(obj)
    console.log(cdmData)


    function arrayConvert(json){
        var arr = [];
        for(index in json){
            var obj = json[index];
            var key = null;
            while(typeof obj == 'object'){
                for(ind in obj){
                    if(key == null) key = ind;
                    obj = obj[ind];
                }
            }
            arr.push({'key':key, 'val':obj});
        }
        return arr;
    }
    return (
        <div>
           {/* {JSON.stringify(cdmData)} */}
           <p> {arrayConvert(cdmData)}</p>
        </div>
    )
}

